import{_ as o,o as t,c as s,z as e,a as n}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 56-14 Streets, etc., of city or town not to be occupied without its consent; compensation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/56-14.md","filePath":"vacode/56-14.md"}'),r={name:"vacode/56-14.md"},c=e("h1",{id:"§-56-14-streets-etc-of-city-or-town-not-to-be-occupied-without-its-consent-compensation",tabindex:"-1"},[n("§ 56-14 Streets, etc., of city or town not to be occupied without its consent; compensation. "),e("a",{class:"header-anchor",href:"#§-56-14-streets-etc-of-city-or-town-not-to-be-occupied-without-its-consent-compensation","aria-label":'Permalink to "§ 56-14 Streets, etc., of city or town not to be occupied without its consent; compensation."'},"​")],-1),i=e("p",null,"No public service corporation, cold storage, compressed air, viaduct, conduit, or bridge company, nor any corporation, association, person, or partnership, engaged in these or like enterprises, shall use, cross, or occupy with its works the streets or alleys, public or private, or the public grounds, of any incorporated city or town, whether along, over or under the same, without the consent of the corporate authorities thereof; and in case any person shall be damaged in his property by any such use, occupation, or crossing, such corporation, association, person, or partnership shall, before using, crossing, or occupying such streets, alleys or public grounds, make compensation therefor to the person so damaged. Such compensation, if the parties cannot agree upon the same, shall be ascertained in the mode prescribed in the laws regulating the exercise of the right of eminent domain.",-1),a=e("p",null,"Code 1919, § 3882.",-1),p=[c,i,a];function h(d,u,l,m,f,_){return t(),s("div",null,p)}const y=o(r,[["render",h]]);export{b as __pageData,y as default};
